    left: "5px",
    margin: "2px 10px 20px 10px",

    fontWeight: "bold",
    backgroundColor: "white",
    color: 'black',
    alignContent: 'left'


}
const content_left = {
    float: "left",

    textAlign: "center",
    backgroundColor: "#CDDC39",

    borderRadius: "15px",

    // margin: "5px",

